import React from "react";


//function component
const Progress = () => {
    //useState(傳入參數) 解構給 name 變數 和 changeName 函式 
    return (
        <React.StrictMode>
            <header>
                header
            </header>
            <div>
                <button onClick={() => {fetch("https://onepiece.nchu.edu.tw/cofsys/plsql/crseqry_home_now HTTP",
                {
                    method: "POST",
                    headers: {
                        "Content-Type": "application/x-www-form-urlencoded",
                        "Accept": "text/html,application/xhtml+xml,application/xml;q=0.9,image/avif,image/webp,image/apng,*/*;q=0.8",
                        
                    },
                    body: JSON.stringify({
                        email: 'lovef1232e@hexschool.com',
                        password: '12345678'
                    })
                })
                .then(response => response.json())
                .then(json => console.log(json))}
                }>按我</button>

            </div>
            <footer>
                footer
            </footer>
        </React.StrictMode>
    );
    //fetch(url).then(參數 => 回傳值).then(參數 => 函式內容).catch(err => 回報錯誤)
}

export default Progress;
